import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from 'react'
import { Link } from 'react-router-dom'
import './index.css'
import { toast } from 'react-toastify'
import axios from 'axios'
import { useNavigate } from 'react-router'
import { URL } from '../../config'
import './index.css'
import Navibar from '../../Components/Navbar/Navibar';
import "../Signin/style.css"
import validation from "../Signin/validation";

const Signin = () => {

  return (

    <form className="login" action method="get">
      <div className="formGroup">
        <input type="email" placeholder="Email ID" name="email" required autoComplete="off" />
      </div>
      <div className="formGroup">
        <input type="password" id="password" placeholder="Password" required autoComplete="off" />
      </div>
      <div className="checkBox">
        <input type="checkbox" name="checkbox" id="checkbox" />
        <span className="text">Keep me signed in on this device</span>
      </div>
      <div className="formGroup">
        <button type="button" className="btn2">REGISTER</button>
      </div>
    </form>
  );
}
export default Signin
